import Link from 'next/link';

function MovieInfoLink({ id, src, koreanTitle }) {
    return (
        <Link href="/movieInfo/[id]" as={`/movieInfo/${id}`}>
          <a>
            <img src={src} style={{ width: '100%', height: '310px', borderRadius: '10px' }} />
            <div>{koreanTitle}</div>
          </a>
        </Link>
    )
};

export default MovieInfoLink;
